import { useNavigate } from 'react-router-dom';
import TenantLeaseCard from '../components/TenantLeaseCard';
import TenantPayments from '../components/TenantPayments'; // Make sure this exists

export default function Profile({ user }) {
  const navigate = useNavigate();

  return (
    <div style={{ padding: '2rem', fontFamily: 'Segoe UI, sans-serif' }}>
      <h2>Tenant Profile</h2>
      <p><strong>Name:</strong> {user.name}</p>
      <p><strong>Email:</strong> {user.email}</p>

      <section style={{ marginTop: '2rem' }}>
        <h3>Lease Info</h3>
        <TenantLeaseCard userId={user.user_id} />
      </section>

      <section style={{ marginTop: '2rem' }}>
        <h3>Payment History</h3>
        <TenantPayments userId={user.user_id} />
      </section>

      {(user.role === 'tenant' || user.role === 'landlord') && (
        <div style={{ marginTop: '2rem' }}>
          <button onClick={() => navigate('/payments')}>Make a Payment</button>
        </div>
      )}
    </div>
  );
}
